import React, {Component} from 'react'
import {NextPageContext} from "next";

interface Props {
    title?: string;
    locale?: string;
}

export default class Index extends Component<Props> {

    static async getInitialProps({ req }: NextPageContext) {
        const title = 'Accueil';
        return { title }
    }

    render() {
        const { title, locale } = this.props;
        return (
            <div>
                <h1>{title}</h1>
            </div>
        )
    }
}
